import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Login.css";

const SellerSignUpPage = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    orgName: "",
    businessNumber: "",
    businessEmail: "",
    password: "",
  });

  const [showPassword, setShowPassword] = useState(false);
  const togglePassword = () => setShowPassword(!showPassword);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Seller Sign Up Data:", formData);
    alert("✅ Seller account created successfully!");
  };

  return (
    <div className="login-container">
      <div className="login-card" style={{ paddingBottom: "40px" }}>
        {/* ======= HEADER ======= */}
        <div className="login-header">
          <h2 className="logo-text">LiftOff</h2>
          <p className="info-login">Create your Seller Account</p>
        </div>

        {/* ======= FORM ======= */}
        <form className="login-form" onSubmit={handleSubmit} noValidate>
          {[
            { id: "firstName", label: "First Name", type: "text" },
            { id: "lastName", label: "Last Name", type: "text" },
            { id: "orgName", label: "Organization Name", type: "text" },
            { id: "businessNumber", label: "Business Number", type: "text" },
            { id: "businessEmail", label: "Business Email", type: "email" },
          ].map((field) => (
            <div
              key={field.id}
              className="form-group"
              style={{ marginBottom: "12px" }} // reduce spacing between fields
            >
              <label
                htmlFor={field.id}
                style={{
                  display: "block",
                  marginBottom: "3px", // label closer to input
                  color: "#3d4468",
                  fontWeight: "600",
                  fontSize: "14px",
                }}
              >
                {field.label}
              </label>
              <div
                className="neu-input"
                style={{
                  padding: "0px",
                  height: "45px",
                  display: "flex",
                  alignItems: "center",
                }}
              >
                <input
                  type={field.type}
                  id={field.id}
                  name={field.id}
                  placeholder=" "
                  value={formData[field.id]}
                  onChange={handleChange}
                  required
                  style={{
                    padding: "10px 18px", // compact inner padding
                    fontSize: "14px",
                  }}
                />
                <label htmlFor={field.id}>{field.label}</label>
              </div>
            </div>
          ))}

          {/* Password */}
          <div className="form-group" style={{ marginBottom: "12px" }}>
            <label
              htmlFor="password"
              style={{
                display: "block",
                marginBottom: "3px",
                color: "#3d4468",
                fontWeight: "600",
                fontSize: "14px",
              }}
            >
              Password
            </label>
            <div
              className="neu-input password-group"
              style={{
                padding: "0px",
                height: "45px",
                display: "flex",
                alignItems: "center",
              }}
            >
              <input
                type={showPassword ? "text" : "password"}
                id="password"
                name="password"
                placeholder=" "
                value={formData.password}
                onChange={handleChange}
                required
                style={{
                  padding: "10px 18px",
                  fontSize: "14px",
                }}
              />
              <label htmlFor="password">Password</label>

              <button
                type="button"
                className={`neu-toggle ${showPassword ? "show-password" : ""}`}
                onClick={togglePassword}
                aria-label="Toggle password visibility"
              >
                <svg
                  className="eye-open"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                >
                  <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z" />
                  <circle cx="12" cy="12" r="3" />
                </svg>
                <svg
                  className="eye-closed"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                >
                  <path d="M17.94 17.94A10.07 10.07 0 0 1 12 20c-7 0-11-8-11-8a18.45 18.45 0 0 1 5.06-5.94M9.9 4.24A9.12 9.12 0 0 1 12 4c7 0 11 8 11 8a18.5 18.5 0 0 1-2.16 3.19m-6.72-1.07a3 3 0 1 1-4.24-4.24" />
                  <line x1="1" y1="1" x2="23" y2="23" />
                </svg>
              </button>
            </div>
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="neu-button signup-btn"
            style={{ marginTop: "10px" }}
          >
            <span className="btn-text">Sign Up as Seller</span>
          </button>

          {/* Back to Home */}
          <button
            type="button"
            className="neu-button"
            onClick={() => navigate("/")}
            style={{
              background: "#e5e9ef",
              color: "#3d4468",
              fontWeight: "600",
              marginTop: "8px",
              padding: "12px 24px",
            }}
          >
            ← Back to Home Page
          </button>
        </form>
      </div>
    </div>
  );
};

export default SellerSignUpPage;
